import React from 'react';
import './Country.css';
import { useSelector } from 'react-redux';

const Country = () => {
     const { characters } = useSelector(state => state.Country);
     return (
        <div></div>
        (characters.map(char => <Country
               key={char.name}
               name={char.name}
               flag={char.flag}
               capital={char.capital}
               continet={char.continent}
               population={char.poblation}
               // onClose={() => props.onClose(char.id)} 
               />
             )))
            } 
         




export default Country;
